private void applyFilters(FormDataSource _formDataSource)
{
    SysQuery::findOrCreateRange(_formDataSource.query().dataSourceTable(tableNum(SalesLine)), fieldNum(SalesLine, SalesId)).value(element.salesIdRangeValue());
    SysQuery::findOrCreateRange(_formDataSource.query().dataSourceTable(tableNum(SalesLine)), fieldNum(SalesLine, CustAccount)).value(this.custAccountRangeValue());
    SysQuery::findOrCreateRange(_formDataSource.query().dataSourceTable(tableNum(SalesLine)), fieldNum(SalesLine, ShippingDateRequested)).value(this.shippingDateRequestedIdRangeValue());
}

private void applySiteWHFilters(FormDataSource _formDataSource)
{
    SysQuery::findOrCreateRange(_formDataSource.query().dataSourceTable(tableNum(InventDim)), fieldNum(InventDim, InventSiteId)).value(element.inventSiteIdRangeValue());
    SysQuery::findOrCreateRange(_formDataSource.query().dataSourceTable(tableNum(InventDim)), fieldNum(InventDim, InventLocationId)).value(element.inventLocationIdRangeValue());
}

[Hookable(false)]
public InventDimCtrl_Frm inventDimSetupObject()
{
    InventDimCtrl_Frm ret = inventDimFormSetupTmpRelease;

    if (this.selectedControl().name() == DimensionsDisplaySO.name())
    {
        ret = inventDimFormSetupSO;
    }

    return ret;
}

[Hookable(false)]
public void updateDesign_SO(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetupSO)
            {
                inventDimFormSetupSO  = InventDimCtrl::newFromFormValidDataSource(element, inventDimSO_ds.name());
            }

            InventDimParm inventDimParmLocal;
            inventDimParmLocal.setAllInventDim();
            inventDimParmLocal.clearProductDimensions();
            inventDimFormSetupSO.parmDimParmVisibleGrid(inventDimParmLocal);
        // do continue
        case InventDimFormDesignUpdate::Active:
            inventDimFormSetupSO.formActiveSetup(InventDimGroupSetup::newItemId(SalesLine.ItemId));
            inventDimFormSetupSO.formSetControls(true);
            break;

        default:
            throw error(strFmt("@SYS54195",funcName()));
    }
}

[Hookable(false)]
public void updateDesign_TmpRelease(InventDimFormDesignUpdate _mode)
{
    switch (_mode)
    {
        case InventDimFormDesignUpdate::Init:
            if (!inventDimFormSetupTmpRelease)
            {
                inventDimFormSetupTmpRelease  = InventDimCtrl::newFromFormValidDataSource(element, InventDimTmpRelease_ds.name());
            }

            InventDimParm inventDimParmLocal;
            inventDimParmLocal.setAllInventDim();
            inventDimParmLocal.clearProductDimensions();
            inventDimFormSetupTmpRelease.parmDimParmVisibleGrid(inventDimParmLocal);
        // do continue
        case InventDimFormDesignUpdate::Active:
            inventDimFormSetupTmpRelease.formActiveSetup();
            inventDimFormSetupTmpRelease.formSetControls(true);
            break;

        default:
            throw error(strFmt("@SYS54195",funcName()));
    }
}

