    qbrReleaseToWarehouseId = qbdsWHSTmpReleaseToWarehouse.addRange(fieldNum(WHSTmpReleaseToWarehouse, ReleaseToWarehouseId));

    this.cacheAddMethod(tableMethodStr(WHSTmpReleaseToWarehouse, displayRequestedHandlingQty));

    element.updateDesign_TmpRelease(InventDimFormDesignUpdate::Init);
