[Hookable(false)]
public void init()
{
    super();

    QueryBuildDataSource salesLineQbds = SalesLine_ds.query().dataSourceTable(tableNum(SalesLine));
    salesLineQbds.addRange(fieldNum(SalesLine, InventTransId));
    salesLineQbds.addRange(fieldNum(SalesLine, InventDimId));
    salesLineQbds.addRange(fieldNum(SalesLine, RemainInventPhysical)).value('>0');

    QueryBuildDataSource whsSalesLineQbds = salesLineQbds.addDataSource(tableNum(WHSSalesLine));
    whsSalesLineQbds.joinMode(JoinMode::ExistsJoin);
    whsSalesLineQbds.relations(true);
    whsSalesLineQbds.addRange(fieldNum(WHSSalesLine, QtyLeftToLoad)).value('>0');

    QueryBuildDataSource qbdsWHSInventEnabled = salesLineQbds.addDataSource(tableNum(WHSInventEnabled));
    qbdsWHSInventEnabled.joinMode(JoinMode::ExistsJoin);
    qbdsWHSInventEnabled.addLink(fieldNum(SalesLine, ItemId), fieldNum(WHSInventEnabled, ItemId), salesLine_ds.name());

    this.cacheAddMethod(tableMethodStr(SalesLine, whsDisplaySalesOrgin));
    this.cacheAddMethod(tableMethodStr(SalesLine, whsDisplayCustName));
    this.cacheAddMethod(tableMethodStr(SalesLine, whsDisplayCustAvailCredit));
    this.cacheAddMethod(tableMethodStr(SalesLine, whsDisplayItemName));

    element.updateDesign_SO(InventDimFormDesignUpdate::Init);
}

[Hookable(false)]
public void displayOption(Common _record, FormRowDisplayOption _options)
{
    if (showUnreservedDemand)
    {
        SalesLine locSalesLine = _record;

        InventQty onOrderQty = locSalesLine.onOrder();

        if (onOrderQty == 0)    // Fully Reserved
        {
            _options.backColor(WinAPI::RGB2int(#WHSPastelGreen));
        }
        else if (onOrderQty != locSalesLine.QtyOrdered)  // Partially Reserved
        {
            _options.backColor(WinAPI::RGB2int(#WHSPastelBlue));
        }
    }

    super(_record, _options);
}

