void clicked()
{

    SalesLine salesLineLocal;

    super();

    for (salesLineLocal = SalesLine_ds.getFirst(true) ? SalesLine_ds.getFirst(true) : SalesLine_ds.cursor(); salesLineLocal;
    salesLineLocal = SalesLine_ds.getNext())
    {
        whsReleaseToWarehouseForm.addOrderLine(salesLineLocal.InventTransId, whsTmpReleaseToWarehouse, WHSModule::Sales);
    }

    whsTmpReleaseToWarehouse_ds.executeQuery();
}

void clicked()
{
    super();

    SalesLine_ds.executeQuery();

    QueryRun qr = SalesLine_ds.queryRun();
    SalesLine   salesLineLocal;

    do
    {
        salesLineLocal = qr.get(tableNum(SalesLine));

        whsReleaseToWarehouseForm.addOrderLine(salesLineLocal.InventTransId, whsTmpReleaseToWarehouse, WHSModule::Sales);
    }
    while (qr.next());

    whsTmpReleaseToWarehouse_ds.executeQuery();
}

void clicked()
{
    super();

    whsReleaseToWarehouseForm.addOrder(salesLine.SalesId, whsTmpReleaseToWarehouse, WHSModule::Sales);

    whsTmpReleaseToWarehouse_ds.executeQuery();
}

public boolean modified()
{
    boolean ret = super();

    if (ret)
    {
        if (SalesIdFilter.text()
            && SalesTable::find(SalesIdFilter.text()).SalesId != SalesIdFilter.text())
        {
            SalesIdFilter.text('');
        }

        SalesLine_ds.executeQuery();
    }

    return ret;
}

public boolean modified()
{
    boolean ret = super();

    if (ret)
    {
        if (CustAccountFilter.text()
            && CustTable::find(CustAccountFilter.text()).AccountNum != CustAccountFilter.text())
        {
            CustAccountFilter.text('');
        }

        SalesLine_ds.executeQuery();
    }

    return ret;
}

